function pairElement(str) {
 const Matching = function(char){
    switch(char){
        case "A":
        return ["A","T"];
          case "T":
        return ["T","A"];
          case "C":
        return ["C","G"];
          case "G":
        return ["G","C"];
    }
 };
 const pairs = [];
 for(let i=0; i < str.length; i++){
 pairs.push(Matching(str[i]));
 }
 return pairs;
}

